function CXf(){var a,b;this.i=new EXf(this);Blc(this,NXf(new OXf(this)));a=Aw('{"Misc_Curl": "<p>You can easily launch your request from a terminal if you have <a href=\\"https://curl.haxx.se/\\" target=\\"_blank\\">cURL<\/a> installed. Click on the <span style=\\u201dbackground-color: grey\\u201d>\\"Save/Save as\\"<\/span> selector and <span style=\\u201dbackground-color: grey\\u201d><i class=\\"fa fa-file-text\\"><\/i>Copy to cUrl<\/span> entry and you will be provided the curl command to copy-paste.<\/p>\\n", "General_Review": "<p>Restlet Client development started five years ago, we make Restlet Client with love just for you. If you like Restlet Client please write a review <a href=\\"https://chrome.google.com/webstore/detail/restlet-client/aejoelaoggembcahagimdiliamlcdmfm\\" target=\\"_blank\\">here<\/a>.<\/p>\\n", "Scenarios_Manage": "<p>Clicking on the name of your scenario in the left panel will show the overview where you can run, re-order, rename and\\ndescribe your scenario. You can also automatize the process by launching your scenarios via the\\n<a href=\\"https://restlet.com/documentation/client/user-guide/automate/run-tests-from-cli\\" target=\\"_blank\\">\\nMaven plugin <i class=\\"fa fa-external-link\\" style=\\"font-size: 12px\\" aria-hidden=\\"true\\"><\/i>\\n<\/a>.<\/p>\\n", "Expressions_Description": "<p>Expressions allow you to transform data or to interconnect requests/responses. You can easily make a reference on an existing request or/and a response or its parts.<\/p>\\n<p>More information on expressions is available in the <a href=\\"https://restlet.com/documentation/client/user-guide/test/make-your-requests-and-assertions-dynamic/expressions\\" target=\\"_blank\\">user guide<\/a>.<\/p>\\n", "Settings_Follow_Redirects": "<p>You can tell Restlet Client whether to follow redirects by clicking on the down-facing arrow at the right of the <code>Send<\/code> button.<\/p>\\n<p>If you want to set the behavior once and for all, go to <a href=\\"#settings\\">Settings<\/a>, and check/uncheck the <code>Follow redirects<\/code> option in the <code>HTTP<\/code> section.<\/p>\\n", "Settings_Appearance": "<p>Some response bodies aren\\u2019t displayed the way you\\u2019d like them to be? You can customize which formatter will be applied to a given media type in <a href=\\"#settings\\">Settings<\/a> in the <code>Appearance<\/code> section.<\/p>\\n", "Body_options_Content_type": "<p>Click on the content type - JSON, XML \\u2026 - below the body of your request to switch the syntactic coloring and add the right <code>Content-Type<\/code> header.<\/p>\\n", "Body_options_Evaluation": "<p>Sometimes you will want to avoid evaluating expressions in the body of your request, either for performance reasons or the body contains text that is similar to an expression.<\/p>\\n<p>You can enable/disable request body evaluation by checking/unchecking the box at the bottom of the body.<\/p>\\n", "Settings_Cache": "<p>Annoyed by a cache ? You can make sure to get a fresh version of the resource every time by checking the cache buster option. It is located in <a href=\\"#settings\\">Settings<\/a> under the section <code>HTTP<\/code>.<\/p>\\n", "Sharing": "<p>Share your API projects with ease by simply clicking the <i class=\\"fa fa-ellipsis-v\\"><\/i> button next to a project in your repository and selecting <code>Share<\/code>.<\/p>\\n<p>A project name changes color when successfully shared.<\/p>\\n", "Scenarios_Create": "<p>API scenarios are chains of interconnected requests. They simplify complex API testing scenarios. Just create a scenario and save your tests there.<\/p>\\n", "Expressions_VisualBuilder": "<p>You can include parts of a request in another, use environment variables and/or make your requests dynamic using built-in methods with expressions.<\/p>\\n<p>To build them easily, you can click on the <i class=\\u201dfa fa-magic\\u201d><\/i> button at the end of an input field. The expression will be inserted at your cursor\\u2019s position and evaluated when your request is sent.<\/p>\\n", "General_Studio": "<p>Restlet Client is one of three modules on the Restlet platform, why not check out <a href=\\"https://restlet.com/modules/studio/\\" target=\\"_blank\\">Restlet Studio<\/a> - our Visual web API Designer?<\/p>\\n", "Maven": "<p>If you have plenty of requests with assertions don\\u2019t hesitate to export your repository and use the Maven plugin to make it part of your continuous integration process.<\/p>\\n<p>More information is available in <a href=\\"https://vimeo.com/155994902\\" target=\\"_blank\\">this video<\/a>.<\/p>\\n", "Synchronization": "<p>Never lose your data with cloud synchronization. Go to <a href=\\"#settings\\">Settings<\/a> and enable it on the <code>General<\/code> section.<\/p>\\n<p>You can also manually start repository cloud synchronization by clicking on the <i class=\\"fa fa-refresh\\"><\/i> icon located in the header panel.<\/p>\\n", "Expressions_Edition": "<p>To edit an expression, click on the <i class=\\"fa fa-magic\\"><\/i> button at the end of an input field.  Your cursor must be in the expression you want to edit when you click the button.<\/p>\\n<p>More information on expressions is available in the <a href=\\"https://restlet.com/documentation/client/user-guide/test/make-your-requests-and-assertions-dynamic/expressions\\" target=\\"_blank\\">user guide<\/a>.<\/p>\\n", "General_Cloud": "<p>Restlet Client is one of three modules on the Restlet platform, come check out <a href=\\"https://restlet.com/modules/cloud/\\" target=\\"_blank\\">Cloud<\/a> - The cloud platform for web APIs. Create, deploy and run APIs without writing a single line of code.<\/p>\\n", "Settings_Method_Bodies": "<p>You can customize which HTTP methods have bodies in <a href=\\"#settings\\">Settings<\/a> in the section <code>HTTP<\/code>.<\/p>\\n", "Environments": "<p>You can run your request in different environments. You can use them in your requests with expressions.\\nThen you just have to switch the selected environment to run your requests/scenarios with different variables.<\/p>\\n", "Misc_Urls": "<p>When response payloads contain hyperlinks, Restlet Client automatically recognizes those URLs.<\/p>\\n<p>When you click on them, it will prepare a new request pointing to that URL.<\/p>\\n", "Assertions": "<p>You can test the result of a request with assertions. Just save your request and click on the <code>Add<\/code> button in the assertions tab.<\/p>\\n", "Misc_Basic_auth": "<p>No need to manually encode your Basic Auth user / password with Base64.<\/p>\\n<p>Click on <code>Add authorization<\/code> under the headers and Restlet Client will do it for you.<\/p>\\n"}\n');b=new _oi(GXf(a));opi(b,new Nui(Fic($wnd.Math.round(tw()))));this.j=new Aai(b);Vx(this.k,wL(zai(this.j,0)));hc(this.a,new HXf(this),(pC(),pC(),oC));hc(this.e,new JXf(this),(null,oC));ee(this.e,false);hc(this.d,new LXf(this),(null,oC))}
